var probIdx = 0;
var isHidden = true;


function randInt(min, max) {
  min = Math.ceil(min);
  max = Math.floor(max);
  return Math.floor(Math.random() * (max - min)) + min;
}

function randBool() {
  return Math.random() >= 0.5;
}
function randExp() {
  return Math.pow(10, randInt(1, 6));
}
function randItem(arr) {
  return arr[randInt(0, arr.length-1)];
}

function setupKeyEvents() {
  document.addEventListener('keydown', (event) => {
    const keyName = event.key;
    if (keyName == "ArrowLeft") {
      probIdx--;
      probIdx = (probIdx + probs.probs.length) % probs.probs.length;
      loadProblem(probIdx);
    } else if (keyName == "ArrowRight") {
      probIdx++;
      probIdx = (probIdx + probs.probs.length) % probs.probs.length;
      loadProblem(probIdx);
    }
  });

  $("#btnrand").click((event) => {
    probIdx = randInt(0, probs.probs.length-1);
    loadProblem(probIdx);
  });

  $("#btnprev").click((event) => {
    probIdx--;
    probIdx = (probIdx + probs.probs.length) % probs.probs.length;
    loadProblem(probIdx);
  });

  $("#btnnext").click((event) => {
    probIdx++;
    probIdx = (probIdx + probs.probs.length) % probs.probs.length;
    loadProblem(probIdx);
  });

}

function updateIndex() {
  $("#probIdx").text(probIdx);
  $("#probCount").text(probs.probs.length);
}

// helper to make using handlerbars easier
function genHTML(elid, data) {
  var source   = $(elid).html();
  var template = Handlebars.compile(source);
  return template(data);
}

function updateSolHidden() {
  if (isHidden) {
    $(".sol").hide();
  } else {
    $(".sol").show();
  }
}

function loadProblem(idx) {
  console.log(idx);
  if (idx < 0 || idx >= probs.length) return false;

  var html = genHTML("#entry-template", { 
    prob: probs.probs[idx],
    solution: probs.probs[idx].solution
  });

  $("#problem").html(html);
  updateSolHidden();

  updateIndex(idx);
  return idx;
}
